<h1>{coin.name}</h1>
<h1>{coin.price}</h1>
</>
}
function App() {
    const[allcoins,setallcoins]=useState([])
    useEffect(()=>{
       Axios.get("https://api.coinstats.app/public/v1/coins?skip=0").then((resp)=>{
          setallcoins(resp.data.coins)
       });
    },[])
    
    return (
        <>
            <div className="container">
              <div className='cryptoh'></div>
              <div className='cryptod'>{allcoins.map((coin)=>{
                  return (<h1>{coin.name}</h1>)
              })}</div>
              
            </div>
        </>
    )
}

export default App
